import React from "react";
import { Typography } from "@material-ui/core";
import styles from "./CompareSection.module.css";

export default function CompareSection(props) {
  return (
    <div className="root">
      <Typography variant="h5" className="sectionName">
        {props.sectionName}
      </Typography>

      <Typography className="candidate">Candidate</Typography>

      <Typography className="business">Business</Typography>
    </div>
  );
}
